  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:11.938707\",\n\t\"name\": \"prime-hook-national-wildlife-refuge-fire-management-plan-2002\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Department of the Interior fire management
  policy requires that all national wildlife refuges with vegetation that can sustain
  fire have a Fire Management Plan (FMP). An FMP must detail fire management guidelines
  for site-specific operational procedures and identify refuge values to be protected
  and enhanced. These guidelines include descriptions of habitat types, fire effects
  on vegetation fuels, soils, wildlife resources and air quality, fire preparedness,
  prescribed fire applications, wildfire suppression tactics and strategies and prevention
  techniques. The safe use of prescribed fire (Rx) as a tool in ecosystem management
  is important to the refuge. Rx is an essential option for maintaining many of the
  refuge's fire-dependent native plant communities and early successional habitats.
  Other benefits include reducing hazardous fuel loads, thinning over-stocked stands,
  increasing native forage plant production and improving wildlife habitats.\",\n\t\"license_title\":
